import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import './login.css';
import App from './App';
import { AuthContextProvider } from './context/Authcontext';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>

    <AuthContextProvider>
        <App />    
    </AuthContextProvider>
  </React.StrictMode>
);

